import {gradient} from "../../services/gradient";
import {Post} from "./Post/Post";
import {API} from "../../services/api";
import {Card, List} from "antd";

export const Home = () => {

    const [posts, setPosts] = useState()

    useEffect(() => {
        API.get("/post/all")
            .then((response) => {
                setPosts(response.data)
            })
